DataSource.SelectSQLQuery:
SELECT  enty_type ,NOTE_ID
	FROM NOTE_DOMN_ASSN where ENTY_TYPE != 'SYSTEM DOMAIN' and ENTY_TYPE not like 'ATTACH%' and ENTY_TYPE != 'LEGACYCONTRACT'
	and NOTE_ID = {0} and NOTE_VRSN_NBR = {1}

SelectSQLQuery.STATIC:
select distinct A.note_id,A.NOTE_VRSN_NBR,B.NOTE_NM from NOTE_DOMAIN_OVRD_VAL A,NMST_NOTE_MSTR B 
				where A.PRMRY_ENTY_ID = {0} and A.PRMRY_ENTY_TYPE ={1} and A.SCNDRY_ENTY_ID ={2} 
				and A.SCNDRY_ENTY_TYPE = {3} and A.ADQM_ADMN_QSTN_NBR = {4}

select distinct A.note_id,A.NOTE_VRSN_NBR,B.NOTE_NM from TIER_NOTE_OVRD_VAL A,NMST_NOTE_MSTR B 
				where A.TIER_SYS_ID={8} and A.PRMRY_ENTY_ID = {0} and A.PRMRY_ENTY_TYPE ={1} and A.SCNDRY_ENTY_ID ={2} 
				and A.SCNDRY_ENTY_TYPE = {3} and A.ADQM_ADMN_QSTN_NBR = {4}

DataSource.SelectSQLQuery:
select distinct NOTE_ID,NOTE_VRSN_NBR
from TIER_NOTE_OVRD_VAL
where PRMRY_ENTY_ID = {0} 
and PRMRY_ENTY_TYPE={3}
and SCNDRY_ENTY_ID = {1}
and SCNDRY_ENTY_TYPE = {4}
and ADQM_ADMN_QSTN_NBR = {2}
and TIER_SYS_ID = {5}
